INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "春咲 ひより", 1001);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", "みんなみたいに\nわたしも強くならなきゃ", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "草野 優衣", 1002);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", "フェンシングを始めてみては？", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "士条 怜", 1003);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", "ねぇ、にいちゃん！", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "穂高 みそぎ", 1004);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "私といっしょに…\nいかない？", "ねぇ…", "風宮あかりです", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "風宮 あかり", 1006);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "食べ物の恨みは怖いのー", "プリンたべたいのー", "出雲宮子なのー", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "出雲 宮子", 1007);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", "ボクは虹村雪。", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "虹村 雪", 1008);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "フッ…聞いて後悔するがいい！", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "柊杏奈", 1009);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "マホマホ王国のプリンセス、\nまほ姫どす", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "姫宮 真歩", 1010);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲璃乃です！", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "衣之咲 璃乃", 1011);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "柏崎 初音", 1012);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", "ちょす！\n美波鈴奈だよ～♪", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "美波 鈴奈", 1016);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", "はいたーい。\n喜屋武香織さー。", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "喜屋武 香織", 1017);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", "支倉伊緒です。", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "支倉 伊緒", 1018);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "茜 ミミ", 1020);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "ふぇぇぇぇぇん……", "あの……\nふぇ……", "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "栗林 くるみ", 1021);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", "風宮よりです。\nあああああ！", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "風宮 より", 1022);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "北条 綾音", 1023);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", "わっ…わっ…私、\n天野すずめといいます！", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "天野 すずめ", 1025);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", "……クスクス…私は\n…倉石恵理子……", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "倉石 恵理子", 1027);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "佐々木 咲恋", 1028);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", "桜井望だよ！\nよろしくねっ", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "桜井 望", 1029);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", "デケデケデンっ！", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "ニノン・ジュベール", 1030);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", "上喜しのぶです。\n手元のドクロが父です。", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "上喜 しのぶ", 1031);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", "目指すはビッグな\nお笑い芸人だっぺ！", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "野戸まひる", 1033);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "綾瀬 ゆかり", 1034);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", "氷川鏡華…です", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "氷川 鏡華", 1036);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", "柏崎…栞です。", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "柏崎 栞", 1038);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", "ふ、双葉碧です。", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "双葉 碧", 1040);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角千歌です。", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "三角 千歌", 1042);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", "安芸真琴だ。", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "安芸 真琴", 1043);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", "わらわこそは夜を総べる者！", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "イリヤ・オーンスタイン", 1044);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", "そこで騎士は妖精を乱暴に……", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "遠見 空花", 1045);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "宮坂たまき", 1046);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", "大神美冬よ！", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "大神 美冬", 1048);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", "星野静流だよ！", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "星野静流", 1049);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", "アタシは玉泉美咲。", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "玉泉美咲", 1050);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "？？？？", "？？？？", "？？？", 1, 0, 2, 1, 0, 1, 0, 1.4, 0, "リマ", 1052);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "モニカ・ヴァイスヴィント", 1053);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "ペコリーヌ", 1058);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "コッコロ", 1059);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 1, 0, 2, 1, 0, 1, 0, 1.5, 0, "キャル", 1060);
